import React from "react"

var name = "Khoi"


function Button() {
    return (
        <button className="btn">Click</button>
    )
}
function PostItem(props) {
    return (
        <div>
            <button className={props.name}>
                {props.title}+"Hi"
            </button>
        </div>
    )
}
export default function MyApp() {
    return (
        <div>

            <Button />
            <PostItem/>
            <PostItem
                title="dksald"
                name="dkfasldjf"
            />
        </div>
    )
}
